function Encode_Audio_Data(e) {
  var t = 0;

  while (t < e && ringbuf.read_some(local_data_) > 0) {
    if (g_sharbuffer && g_lock) {
      //  var startTime1 = performance.now()
      var o = new Uint16Array(g_sharbuffer);
      g_lock.lock();

      if (!g_bAec) {
        o[2] = 0;
        g_bAec = true;
      } else {
        //var startTime1 = Performance.now()
        // count = o[2];
        // if (count > 5) {
        //     console.log("Encode too many AEC data in sharedBuffer" + count);
        // }
        if (o[2] != 0) {
          var sampleNumber = o[2];
          var cursor = 2 + 1;

          while (sampleNumber > 0) {
            sampleNumber--;
            o[2]--;
            var sampleHz = o[cursor];
            var nn = cursor + 2;
            cursor += o[cursor + 1];
            cursor += 2;
            var int16Data = new Uint16Array(o.subarray(nn, cursor));
            var int8Data = new Uint8Array(int16Data.buffer);

            if (audio_handle) {
              // if (ws10) {
              //     ws10.send(r);
              // }
              put_pre_aec_audio(audio_handle, int8Data, sampleHz, 1, int16Data.length);
            }
          }
        }
      }

      g_lock.unlock();
    }

    while (aec_buffer.getLength() > 0) {
      // aec_buffer.enqueue({data:t.data,sampleHz:t.sampleHz})
      // put_pre_aec_audio(audio_handle, t.data, t.sampleHz, 1, t.data.length)
      var data = aec_buffer.dequeue();
      put_pre_aec_audio(audio_handle, data.data, data.sampleHz, 1, data.data.length / 2);
    }

    t++;
    audio_encode(audio_handle, local_data_ptr_, audio_sample_rate / 100, 0, audio_sample_rate);
  }
}

