function put_aec_data(data) {
  if (g_mute == -1 || g_mute == 2 || !g_sharbuffer || !g_lock || data == null || data.data.length > 960) {
    return;
  }

  var o = new Uint16Array(g_sharbuffer);
  g_lock.lock();

  if (o[2] < g_shareBufferSampleNumb) {
    var sampleNumb = 0;
    var cursor = 2 + 1;
    {
      sampleNumb = o[2];
      var index = sampleNumb;

      while (index > 0) {
        index--;
        cursor += o[cursor + 1];
        cursor += 2;
      }
    } //var r = audio_queue.dequeue();

    if (data) {
      var s = new Uint16Array(data.data.buffer);
      o[2]++;
      o[cursor] = data.sampleHZ;
      o[cursor + 1] = s.length;
      cursor += 2;
      o.set(s, cursor); // r = audio_queue.dequeue()
    }
  } else {
    console.log("too many data in sharebuffer!");
    o[2] = 0;
  }

  g_lock.unlock();
}

